import { Chart } from 'react-google-charts';
import React from 'react';
import { Spinner } from 'react-bootstrap';

function ComboChart2({ comboChartData }) {
  return (
    <div style={{ overflow: 'hidden', height: '100%', marginBottom: '40px' }}>
      {comboChartData.length !== 0 && (
        <Chart
          width={'100%'}
          height={'100%'}
          chartType='ComboChart'
          loader={
            <>
              <div
                className='spinner'
                style={{
                  display: 'flex',
                  alignItems: 'center',
                  justifyContent: 'center',
                  height: '100%',
                }}
              >
                <Spinner animation='border' variant='primary' />
              </div>
            </>
          }
          data={[['Year', 'TFC', 'AR', 'SPM'], ...comboChartData]}
          options={{
            title: 'Relation b/w TFC, AR, SPM',
            vAxis: {
              title: 'Annual Data',
              viewWindowMode: 'explicit',
              viewWindow: { min: 0 },
            },
            hAxis: { title: 'Year' },
            seriesType: 'bars',
            // series: { 5: { type: 'line' }, 3: { type: 'line' } },
            //   series: {  },
            series: { 1: { type: 'line' }, 2: { type: 'line' } },
            backgroundColor: 'transparent',
            chartArea: {
              width: '80%',
              height: '70%',
            },
            legend: {
              position: 'bottom',
            },
          }}
          rootProps={{ 'data-testid': '1' }}
        />
      )}
    </div>
  );
}

export default ComboChart2;
